import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import EmployeeList from "./components/EmployeeList";
import AddEmployee from "./components/AddEmployee";
import PerformanceReport from "./components/PerformanceReport";
import BellCurveChart from "./components/BellCurveChart";


function App() {
    return (
        <Router>
            <div>
                <h1>Employee Performance App</h1>
                <nav>
                    <ul>
                        <li><Link to="/">Employee List</Link></li>
                        <li><Link to="/add">Add Employee</Link></li>
                        <li><Link to = "/report">PerformanceReport</Link></li>
                        <li><Link to="/bellcurve">Bell Curve Analysis</Link></li>
                    </ul>
                </nav>
                <Routes>
                    <Route path="/" element={<EmployeeList />} />
                    <Route path="/add" element={<AddEmployee />} />
                    <Route path="/report" element={<PerformanceReport />} />
                    <Route path="/bellcurve" element={<BellCurveChart />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
